class User {

    constructor(id, name) {
        this.id = id
        this.name = name

    }
}


export const USERS = [
    new Shop('1', "Abrar"),
    new Shop('2', "Nafiz"),
    new Shop('3', "Somik"),
    new Shop('4', "Tasin"),
    new Shop('5', "Syed")

]
